class Solution {
  int minOperations(List<int> nums, int target) {
    Map<int, int> freq = {};
    int sum = 0;
    for (var num in nums) {
      sum += num;
      int bit = num;
      while (bit > 0) {
        freq[bit] = (freq[bit] ?? 0) + 1;
        bit >>= 1;
      }
    }
    if (sum < target) return -1;

    int ops = 0;
    while (target > 0 && freq.isNotEmpty) {
      int maxBit = 1;
      while (maxBit * 2 <= target) {
        maxBit *= 2;
      }
      if (freq.containsKey(maxBit) && freq[maxBit]! > 0) {
        target -= maxBit;
        freq[maxBit] = freq[maxBit]! - 1;
      } else {
        return -1;
      }
      if (target == 0) break;
      ops++;
      for (int bit = maxBit; bit > 1; bit >>= 1) {
        if (!freq.containsKey(bit) || freq[bit] == 0) {
          freq[bit] = 2;
          freq[bit >> 1] = (freq[bit >> 1] ?? 0) + 2;
          break;
        }
      }
    }
    return target == 0 ? ops : -1;
  }
}
